INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 7, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 7, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 7, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 10, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 10, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 10, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 10, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 12, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 13, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 13, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 13, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 13, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 14, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 14, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 14, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 14, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -470.0, 1, 15, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 16, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 16, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 16, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 16, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 17, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 25, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 25, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 25, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 25, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 18, "カリン", 190801, "2015/12/17 15:00:00", 1, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 18, "カリン", 190801, "2015/12/17 15:00:00", 2, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -470.0, 1, 19, "カリン", 190801, "2015/12/17 15:00:00", 3, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -470.0, 1, 19, "カリン", 190801, "2015/12/17 15:00:00", 4, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -470.0, 1, 20, "カリン", 190801, "2015/12/17 15:00:00", 5, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -470.0, 1, 20, "カリン", 190801, "2015/12/17 15:00:00", 6, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 21, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 21, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 21, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 21, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -430.0, 1, 22, "カリン", 190801, "2015/12/17 15:00:00", 1, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -430.0, 1, 22, "カリン", 190801, "2015/12/17 15:00:00", 2, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -430.0, 1, 23, "カリン", 190801, "2015/12/17 15:00:00", 3, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -430.0, 1, 23, "カリン", 190801, "2015/12/17 15:00:00", 4, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 4.08, 8.0, -385.0, 2, 24, "エリコ（バレンタイン）", 109001, "2019/01/31 12:00:00", 1, 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 5.0, 8.0, -385.0, 2, 24, "エリコ（バレンタイン）", 109001, "2019/01/31 12:00:00", 2, 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 10.11, 8.0, -385.0, 2, 24, "エリコ（バレンタイン）", 109001, "2019/01/31 12:00:00", 3, 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 4.0, 8.0, -385.0, 2, 24, "エリコ（バレンタイン）", 109001, "2019/01/31 12:00:00", 4, 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 6.0, 8.0, -385.0, 2, 24, "エリコ（バレンタイン）", 109001, "2019/01/31 12:00:00", 5, 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "エリコ（バレンタイン）", 109002, "2019/01/31 12:00:00", 6, 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "エリコ（バレンタイン）", 109002, "2019/01/31 12:00:00", 7, 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "エリコ（バレンタイン）", 109002, "2019/01/31 12:00:00", 8, 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "エリコ（バレンタイン）", 109002, "2019/01/31 12:00:00", 9, 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "エリコ（バレンタイン）", 109002, "2019/01/31 12:00:00", 10, 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 2.12, 8.0, -385.0, 2, 24, "シズル（バレンタイン）", 109101, "2019/01/31 12:00:00", 1, 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 0, "2030/12/17 14:59:59", 4.19, 8.0, -385.0, 2, 24, "シズル（バレンタイン）", 109101, "2019/01/31 12:00:00", 2, 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 0, "2030/12/17 14:59:59", 2.3, 8.0, -385.0, 4, 24, "シズル（バレンタイン）", 109101, "2019/01/31 12:00:00", 3, 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "シズル（バレンタイン）", 109102, "2019/01/31 12:00:00", 4, 10011, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 0, "2030/12/17 14:59:59", 5.23, 8.0, -385.0, 2, 24, "シズル（バレンタイン）", 109101, "2019/01/31 12:00:00", 5, 10011, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "シズル（バレンタイン）", 109102, "2019/01/31 12:00:00", 6, 10011, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 5.01, 8.0, -385.0, 2, 24, "シズル（バレンタイン）", 109101, "2019/01/31 12:00:00", 7, 10011, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "シズル（バレンタイン）", 109102, "2019/01/31 12:00:00", 8, 10011, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "シズル（バレンタイン）", 109102, "2019/01/31 12:00:00", 9, 10011, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, 0.0, 1, 24, "シズル（バレンタイン）", 109102, "2019/01/31 12:00:00", 10, 10011, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 26, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 26, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 26, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 26, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 27, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 27, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 27, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 27, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 27004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 28, "カリン", 190801, "2019/09/24 15:00:00", 1, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28001);
