INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2104010, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 42, "シェフィ", 106401, "2015/12/17 15:00:00", 1, 0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 42, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 42, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 43, "ペコリーヌ", 105801, "2015/12/17 15:00:00", 1, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 43, "コッコロ", 105901, "2015/12/17 15:00:00", 1, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -363.0, 1, 43, "キャル", 106001, "2015/12/17 15:00:00", 1, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 44, "アメス", 123001, "2015/12/17 15:00:00", 1, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 1, 44, "アメス", 123001, "2015/12/17 15:00:00", 2, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 5.79, 0.0, -416.5, 2, 45, "アメス", 123001, "2015/12/17 15:00:00", 3, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 0, "2030/12/17 14:59:59", 0.0, 0.0, -371.5, 1, 46, "アメス", 123001, "2015/12/17 15:00:00", 1, 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 0, "2030/12/17 14:59:59", 0.0, 0.0, -416.5, 2, 47, "シズル", 104901, "2015/12/17 15:00:00", 1, 0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001);
